import axios from 'axios';

export const fetchEditUser = (user) => (dispatch) => {
  axios
    .get(`https://jastegri.pythonanywhere.com/edit/`, user)
    .then(({ data }) => {
      //   localStorage.setItem('token', JSON.stringify(data.tokens));

      dispatch(editUser(data));
    })
    .catch((err) => console.log(err.message));
};

const editUser = (data) => ({
  type: 'EDIT_USER',
  payload: data,
});

